import { ThemeOptions } from '@material-ui/core/styles/createMuiTheme';

export const themeOptions: ThemeOptions = {
  palette: {
    type: 'light',
    primary: {
      main: '#a57548',
    },
    secondary: {
      main: '#82ddf0',
    },
    background: {
      default: '#f6c28b',
    },
  },
};
